import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Hello from './components/helloWorld';

const reactDOM = ReactDOM.createRoot(document.getElementById('root'));
reactDOM.render(
  <React.StrictMode>
    <Hello />
  </React.StrictMode>
);

setInterval(Hello, 1000);
